// src/pages/HomePage.jsx
import { Link } from "react-router-dom";

function HomePage() {
  return (
    <div style={{ textAlign: "center", marginTop: "100px" }}>
      <h1>Welcome</h1>
      <Link to="/login">
        <button style={{ margin: "10px" }}>Login</button>
      </Link>
      <Link to="/signup">
        <button style={{ margin: "10px" }}>Signup</button>
      </Link>
    </div>
  );
}

export default HomePage;
